import React, {Component } from 'react';
import down from '../../assets/down.png';
import up from '../../assets/up.png';
import './Setter.css'

export default class Setter extends Component {
    render() {
        return (
            <div className="setter_div">
                <div className="break_div set_length">
                    <p>Break Length</p>
                    <div>
                        <img src={down} alt="play"/>
                        <span className="number">5</span>
                        <img src={up} alt="play"/></div>
                </div>

                <div className="session_div set_length">
                    <p>Session Length</p>
                    <div>
                        <img src={down} alt="down"/>
                        <span className="number">25</span>
                        <img src={up} alt="up"/></div>
                </div>

            </div>
        )
    }
}
